If you are mentally tired and physically tired, and you feel so heavy in your heart, you feel weights in your heart because of your hard work, like studies, chores, responsibilties, and loneliness..

Jesus says; 

"Come to Me all those who are weary and burdened, I will give you rest. Take My yoke and learn from Me, for I Am Gentle and Humble in heart; you will find rest for your souls. For My yoke is easy, and My burden is Light"(Matthew 11:28-30).
